import React from "react";

const Services2 = () => {
  return (
    <>
      <div className="Serices2-box">
        <h1>
          Choose Your Business
          <br />
          And find out how to increase efficiency
        </h1>
      </div>
      <div className="Services2-img"></div>
    </>
  );
};

export default Services2;
